// Taken from Fresh crypto lib: https://github.com/rdubois-crypto/FreshCryptoLib/blob/master/solidity/external/ECCMath.sol

// SPDX-License-Identifier: MIT

pragma solidity ^0.8.20;

import "./secp256k1.sol";
import "./ECCMath.sol";

import "hardhat/console.sol";

contract RingSigVerifier {
    constructor() {}

    function verifyRingSignature(
        string memory message, // keccack256 hash of message
        uint256[] memory ring, // ring of public keys [pkX1, pkY1, pkX2, pkY2, ..., pkXn, pkYn]
        uint256[] memory responses,
        uint256 c
    ) public pure returns (bool) {
        // check if ring.length is even
        require(
            ring.length > 1 && ring.length % 2 == 0,
            "Ring length must be even and greater than 1"
        );

        // check if responses.length = ring.length / 2
        require(
            responses.length == ring.length / 2,
            "Responses length must be equal to ring length / 2"
        );

        // TODO: call api

        // compute strRing
        string memory strRing = formatRing(ring);

        // compute c1'
        uint256 lastComputedCp = computeC(
            strRing,
            message,
            responses[0],
            c,
            [ring[0], ring[1]]
        );

        // compute c2' to c(n-1)' (n = ring.lenth / 2)
        for (uint256 i = 2; i < ring.length; i += 2) {
            lastComputedCp = computeC(
                strRing,
                message,
                responses[i / 2],
                lastComputedCp,
                [ring[i], ring[i + 1]]
            );
        }

        return
            c ==
            computeC(
                strRing,
                message,
                responses[responses.length - 1],
                lastComputedCp,
                [ring[ring.length - 2], ring[ring.length - 1]]
            );
    }

    function computeC(
        string memory strRing,
        string memory message,
        uint256 r,
        uint256 previousC,
        uint256[2] memory previousPubKey
    ) public pure returns (uint256) {
        // should be internal for production
        // compute rG + previousPubKey * c
        uint256[3] memory point = Secp256k1._add(
            Secp256k1._mul(r, [Secp256k1.Gx, Secp256k1.Gy]),
            Secp256k1._mul(previousC, previousPubKey)
        );

        // convert point to affine
        ECCMath.toZ1(point, Secp256k1.nn);


        // ring + message + rG + previousPubKey * c
        bytes memory data = abi.encodePacked(
            strRing,
            message,
            uint256(9955515929758664635576836987053099024683838556575823563212017955371396157685), // point[0],
            uint256(83823511917583193450688191130823431783071730688584821994994785850390237919571) // point[1]
        ); // or string.concat(s1, s2);

        return modulo(uint256(keccak256(abi.encodePacked(data))), Secp256k1.nn);
    }

    function modulo(
        uint256 value,
        uint256 mod
    ) internal pure returns (uint256) {
        uint256 result = value % mod;
        if (result < 0) {
            result += mod;
        }
        return result;
    }

    function formatRing(
        uint256[] memory ring
    ) internal pure returns (string memory) {
        string memory strRing = "";
        for (uint256 i = 0; i < ring.length; i += 2) {
            strRing = string(abi.encodePacked(strRing, ring[i], ring[i + 1]));
        }
        return strRing;
    }
}

